import React, {useState} from 'react';

import {Navbar, Nav, Container, Modal, Form, Button, FormControl, Row} from "react-bootstrap";
import {Switch,BrowserRouter as Router,Route,Link} from "react-router-dom";

import {useDispatch, useSelector} from "react-redux";
import logo from '../Static_images/logo.png';
import word from '../Static_images/logo-text.png';
const Header = () => {
    const [lightState, setLightState] = useState('light')

    return (
        <Row>
            <Navbar  collapseOnSelect expand={'md'} variant={lightState} bg={lightState}>
                <Container>
                    <Navbar.Brand className = 'contents' href='/' >
                        <img src={logo} height = '67.2px'  width='60px' className='d-inline-block align-top'/>
                        <img src={word}  width='350px' className='logoSw'/>
                    </Navbar.Brand>
                    <Nav className={'m-auto'}>
                        <Nav.Link className={'link'} href={'/'}>
                            HOME
                        </Nav.Link>
                        <Nav.Link className={'link'}  href={'/setting'}>
                            SETTING
                        </Nav.Link>
                        <Nav.Link className={'link'}  href={'/help'}>
                            HELP
                        </Nav.Link>
                        <Nav.Link className={'link'}  href={'/about_us'}>
                            ABOUT US
                        </Nav.Link>
                    </Nav>

                </Container>
            </Navbar>
        </Row>

    );
};

export default Header;
